## 面试题

[LeetCode中文](https://leetcode-cn.com/problems/mean-of-absolute-deviation-values/)

[LeetCode英文](https://leetcode.com/problems/mean-of-absolute-deviation-values/)

给定一个整数数组，找到其中最大绝对值的两个数，返回它们的差值。

**示例 1:**

```
输入: [1,2,3,4]
输出: [4,2]
解释: 4 的绝对值最大，且它的两个数的差值为 2。
```

**示例 2:**

```
输入: [1,2,3,4,5]
输出: [5,3]
解释: 5 的绝对值最大，且它的两个数的差值为 3。
```

**说明:**

* 所有输入的数组都是非负整数。
* 输入数组大小不超过 100。

## 思路

1. 先求出数组中的最大值，然后求出数组中的最小值，最后求出最大值与最小值的差值，最后求出最大值与最小值的均值。
2. 先求出数组中的最大值，然后求出数组中的最小值，最后求出最大值与最小值的差值，最后求出最大值与最小值的均值。

