## 题目描述

输入一个整数数组，判断该数组是不是某二叉搜索树的后序遍历的结果。如果是则输出Yes,否则输出No。假设输入的数组的任意两个数字都互不相同。

## 解法一

解法一的思想是：对于每一个节点，判断它的左右子树是否都是后序遍历的结果。

```java
/**
 * @param {number[]} nums
 * @return {boolean}
 */
public boolean verifyPostorder(int[] nums) {
    if (nums == null || nums.length == 0) {
        return true;
    }
    return verify(nums, 0, nums.length - 1);
}

private boolean verify(int[] nums, int start, int end) {
    if (start >= end) {
        return true;
    }
    int root = nums[end];
    int i = start;
    while (i < end && nums[i] < root) {
        i++;
    }
    int j = i;
    while (j < end && nums[j] > root) {
        j++;
    }
    return i == end && verify(nums, start, i - 1) && verify(nums, j, end - 1);
}
```

