### Java

```java
/**
 * @param strs 字符串数组
 * @return 字符串数组的排列
 */
public String[] permutation(String[] strs) {
    List<String> result = new ArrayList<>();
    permutation(strs, result, 0);
    return result.toArray(new String[result.size()]);
}

private void permutation(String[] strs, List<String> result, int index) {
    if (index == strs.length - 1) {
        result.add(String.join("", strs));
        return;
    }
    for (int i = index; i < strs.length; i++) {
        swap(strs, index, i);
        permutation(strs, result, index + 1);
        swap(strs, index, i);
    }
}

private void swap(String[] strs, int i, int j) {
    String temp = strs[i];
    strs[i] = strs[j];
    strs[j] = temp;
}
