## 题目描述

输入一个整数数组，判断该数组是不是某二叉搜索树的后序遍历的结果。如果是则输出Yes,否则输出No。假设输入的数组的任意两个数字都互不相同。

### 解答

二叉搜索树的后序遍历的结果是从小到大排列的，因此我们可以使用递归的方法来判断一个数组是不是某二叉搜索树的后序遍历的结果。

```java
/**
 * @param {number[]} nums
 * @return {boolean}
 */
public boolean verifyPostorder(int[] nums) {
    if (nums == null || nums.length == 0) {
        return false;
    }
    return verifyPostorder(nums, 0, nums.length - 1);
}

public boolean verifyPostorder(int[] nums, int start, int end) {
    if (start >= end) {
        return true;
    }
    int root = nums[end];
    int i = start;
    for (; i < end; i++) {
        if (nums[i] > root) {
            break;
        }
    }
    for (int j = i; j < end; j++) {
        if (nums[j] < root) {
            return false;
        }
    }
    return verifyPostorder(nums, start, i - 1) && verifyPostorder(nums, i, end - 1);
}
```

