## 题目描述

求长度为 `n` 的面积的三角形的周长。

## 解法

### C++

```c++
class Solution {
public:
    double triangleArea(int a, int b, int c) {
        double s = (a + b + c) / 2;
        return sqrt(s * (s - a) * (s - b) * (s - c));
    }
};
```

### Java

```java
public class Solution {
    /**
     * @param a: An integer
     * @param b: An integer
     * @param c: An integer
     * @return: return the area of the triangle
     */
    public double triangleArea(int a, int b, int c) {
        double s = (a + b + c) / 2;
        return Math.sqrt(s * (s - a) * (s - b) * (s - c));
    }
}
```

### 源码分析

`triangleArea` 方法的调用逻辑是：

1. 将三角形的长度转化为矩形的长度，即 `a + b + c`。
2. 将矩形的长度转化为三角形的面积，即 `a * b * c / 2`。

### 复杂度分析

时间复杂度：`O(n)`。

空间复杂度：`O(1)`。

