## 解法一

### Python

```python
class Solution:
    def reOrderArray(self, array):
        """
        :type array: List[int]
        :rtype: List[int]
        """
        odd = []
        even = []
        for i in array:
            if i % 2 == 1:
                odd.append(i)
            else:
                even.append(i)
        return odd + even
```

### C++

