class Solution {
public:
    vector<int> reOrderArray(vector<int> &array) {
        vector<int> odd;
        vector<int> even;
        for (int i = 0; i < array.size(); ++i) {
            if (array[i] % 2 == 1) {
                odd.push_back(array[i]);
            } else {
                even.push_back(array[i]);
            }
        }
        return odd + even;
    }
