请实现一个函数，将一个字符串中的每个空格替换成“%20”。例如，当字符串为We Are Happy.则经过替换之后的字符串为We%20Are%20Happy。

**样例**

```
Input: "We are happy."
Output: "We%20are%20happy."
```

**说明**

1. 如果字符串中没有空格，则直接返回原字符串。
2. 如果字符串中有空格，则需要进行替换。
3. 如果字符串中有多余的空格，则需要进行替换。

