### C++

```c++
class Solution {
public:
    /**
     * @param s: A string
     * @return: A string
     */
    string replaceSpace(string &s) {
        // write your code here
        int n = s.size();
        int cnt = 0;
        for (int i = 0; i < n; ++i) {
            if (s[i] =='') {
                ++cnt;
            }
        }
        int new_n = n + 2 * cnt;
        string new_s(new_n,'');
        int i = n - 1;
        for (; i >= 0; --i) {
            if (s[i] =='') {
                new_s[new_n - 1] = '0';
                new_s[new_n - 2] = '2';
                new_s[new_n - 3] = '%';
                --new_n;
            } else {
                new_s[new_n - 1] = s[i];
                --new_n;
            }
        }
        return new_s;
    }
};
